import { View, Text } from "react-native";
import React from "react";

export default function GameScreen() {
  return (
    <View>
      <Text>Opponent Gues</Text>
      <View>
        <Text>Higher or lower?</Text>
        <View></View>
      </View>
    </View>
  );
}
